import {Todo} from "../model/Todo";

export const searchTodos = () => {
    alert("llamando")
    return fetch('https://jsonplaceholder.typicode.com/todos')
        .then(response => response.json())
        .then(jsonTodos => {
            jsonTodos.map(jt => new Todo(
                jt.userId,
                jt.id,
                jt.title,
                jt.completed
            ))
        })
}
